import React from 'react'
import { Link } from "react-router-dom";
import { Layout, Row, Col, List, Typography } from 'antd'
import DetailSlider from '../components/DetailSlider';

const { Text, Title } = Typography
const { Content } = Layout

const products = [
  { id: '1', label: 'Nutella' },
  { id: '2', label: 'Pane' },
  { id: '3', label: 'Latte' }
];

export const Details = ({ match }) => {
  const product = products.find(item => item.id === match.params.id);
  console.log(products, match.params.id)
  return (

    <Layout>
      <Content style={{ margin: '24px 16px 0' }}>
        <Row>
          <Col span={15} offset={5}>
            <Row>
              <Title level={2} ><span style={{ textTransform: 'capitalize' }} >{product.type}</span>,{product.type} in Uzbekistan - prices, photos, online booking</Title>
              <DetailSlider />
            </Row>
          </Col>
        </Row>
      </Content>
    </Layout >
  )
}

export default Details
